############################################ Funcion para filtrar personajes ###########################################################################

def filtro(respuesta, property):
    if respuesta == "s":
        resp = True # Cambia el valor a True
    else:
        resp = False # Cambia el valor a False

    borrar=[]
    for i in personajes: # Compara en cada personaje que el contenido de la clave sea igual que la respuesta dada (True o False)
        if i[property] != resp:
            borrar.append(i) # Si la respuesta es diferente, se agregará a una lista para eliminarlo posteriormente

    for j in borrar:
        personajes.remove(j) # Se eliminan los personajes seleccionados

